const RoomCard = ({ room }) => (
  <div className="room-card">
    <h3>{room.hotelName}</h3>
    <p>Address: {room.address}</p>
    <p>Rating: {room.rating}</p>
    <p>Price: ${room.price}</p>
    <p>Amenities: {room.amenities}</p>
  </div>
);

export default RoomCard;
